        fetch("https://jsonplaceholder.typicode.com/users").then((result) => {
            result.json().then((res) => {
                console.log(res);
                setData(data);
            })
        })
    }, [data])
    return (
        <div>
            <h2>Api GET Method</h2>
            <Table striped bordered hover className='maptbl' align='center'>
                <thead>
                    <tr>
                        <th>S.N</th>
                        <th>Name</th>
                        <th>Email</th>
                        <th>contact</th>
                    </tr>
                </thead>
                <tbody>

                </tbody>
            </Table>
        </div>
    )
}
